import logo from './logo.svg';
import './App.css';
import ReactPlayer from 'react-player';
function App() {
  const url="https://www.youtube.com/watch?v=dQw4w9WgXcQ"
  return (
    <>
    <h1 style={{textAlign:"center"}}>React Player example</h1>
    <ReactPlayer 
      url={url}
      volume={0.2}
      controls={true}
    />
    </>
  );
}

export default App;
